import Nav from "./Nav";
import Carousel from "./Carousel";
import React from "react";

function App(): JSX.Element {
  const images = [
    {
      src: process.env.PUBLIC_URL + "/assets/example1.webp",
      alt: "Work example 1",
    },
    {
      src: "https://via.placeholder.com/400x250?text=Work+2",
      alt: "Work example 2",
    },
    {
      src: "https://via.placeholder.com/400x250?text=Work+3",
      alt: "Work example 3",
    },
  ];

  return (
    <div>
      <Nav />
      <Carousel images={images} />
    </div>
  );
}

export default App;
